import logo from './logo.svg';
import react, {Component} from 'react'
import './App.css';

class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      monsters: [
        {
          name: 'Frankenstein'
        },
        {
          name: 'Dracula'
        },
        {
          name: 'Zombie'
        }
      ]
    }
  }
    render() {
        return (
            <div className="App">
              {
                this.state.monsters.map(monster => <h1>{ monster.name }</h1>)
              }
            </div>
        )
    }
}

export default App;
